</h2><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Clignotement d'une diode LED:<br>&nbsp;<br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// main.c
//===============================================
#include &lt;reg52.h&gt;
//===============================================
typedef unsigned int uint;
//===============================================
#define PORT P1
//===============================================
sbit LED = PORT^0;
//===============================================
