<a class="Title2" id="clignotement-d-une-diode-led_definition-d-une-constante" href="#clignotement-d-une-diode-led">Définition d'une constante</a>
</h2><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Définition d'une constante:<br>&nbsp;<br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// main.c
//===============================================
#include &lt;reg52.h&gt;
//===============================================
typedef unsigned int uint;
//===============================================
#define LED_ON (0)
#define LED_OFF (!LED_ON)
//===============================================
#define PORT P1
//===============================================
sbit LED = PORT^0;
//===============================================
void GDelay_ms(uint _ms) {
    uint i, j;
    for(i = 0;i &lt; _ms; i++) {
        for(j = 0; j &lt; 125; j++);
    }
}
//===============================================
void main() {
    PORT = 0xFF;
    while(1) {
        LED = LED_ON;
        GDelay_ms(500);
        LED = LED_OFF;
        GDelay_ms(500);
    }
}
//===============================================</pre><br><h2 class="GTitle1 Title1">
<a class="Title2" id="clignotement-d-une-diode-led_inversion-d-une-broche" href="#clignotement-d-une-diode-led">Inversion d'une broche</a>
</h2><br>Résultat:<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Inversion d'une broche:<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
// main.c
//===============================================
#include &lt;reg52.h&gt;
//===============================================
typedef unsigned int uint;
//===============================================
#define PORT P1
//===============================================
sbit LED = PORT^0;
//===============================================
void GDelay_ms(uint _ms) {
    uint i, j;
    for(i = 0;i &lt; _ms; i++) {
        for(j = 0; j &lt; 125; j++);
    }
}
//===============================================
void main() {
    PORT = 0xFF;
    while(1) {
        LED = !LED;
        GDelay_ms(500);
    }
}
//===============================================</pre><br></div>
