<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="clignotement-d-une-led">Clignotement d'une LED</a>
</h1>
<div class="Section6"><br>Schéma électrique.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/gif;base64,"></div><br>Tracé électrique.<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Initialisation de l'ordonnanceur.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
static void GSchTask_initLedFlash() {
    GLedFlash_init();
    GSch_addTask(GLedFlash_update, 0, 500);
}
//===============================================</pre><br>Initialisation des LEDs.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GLedFlash_init() {
    DATA_PORT = 0xFF;
}
//===============================================</pre><br>Clignotement de la LED.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GLedFlash_update() {
    gFlash = !gFlash;
    DATA_PIN = !DATA_PIN;
}
//===============================================</pre><br></div>
</div>
</div>
</div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="chenillard-a-led">Chenillard à LED</a>
</h1>
<div class="Section6"><br>Schéma électrique.&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/gif;base64,"></div><br>Initialisation de l'ordonnanceur.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
static void GSchTask_initLedChenillard() {
    GChenillard_init();
    GSch_addTask(GChenillard_update, 1, 500);
}
//===============================================</pre><br>Initialisation du chenillard.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GChenillard_init() {
    DATA_PORT = 0xFF;
}
//===============================================</pre><br>Pilotage du chenillard.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void GChenillard_update() {
    if(gCount &lt;= 7) GChenillard_updateM0();
    else if(gCount &lt;= 16) GChenillard_updateM1();
    else if(gCount &lt;= 26) GChenillard_updateM2();
    else if(gCount &lt;= 36) GChenillard_updateM3();
}
//===============================================</pre><br>Pilotage du mode M0.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
static void GChenillard_updateM0() {
    if(gCount == 0) {gData = 0x01; gCount = 1;}
    else if(gCount == 1) {gData = 0x02; gCount = 2;}
    else if(gCount == 2) {gData = 0x04; gCount = 3;}
    else if(gCount == 3) {gData = 0x08; gCount = 4;}
    else if(gCount == 4) {gData = 0x10; gCount = 5;}
    else if(gCount == 5) {gData = 0x20; gCount = 6;}
    else if(gCount == 6) {gData = 0x40; gCount = 7;}
    else if(gCount == 7) {gData = 0x80; gCount = 8;}
    DATA_PORT = ~gData;
}
//===============================================</pre><br>Pilotage du mode M1.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
static void GChenillard_updateM1() {
    if(gCount == 8) {gData = 0x01; gCount = 9;}
    else if(gCount == 9) {gData = 0x03; gCount = 10;}
    else if(gCount == 10) {gData = 0x06; gCount = 11;}
    else if(gCount == 11) {gData = 0x0C; gCount = 12;}
    else if(gCount == 12) {gData = 0x18; gCount = 13;}
    else if(gCount == 13) {gData = 0x30; gCount = 14;}
    else if(gCount == 14) {gData = 0x60; gCount = 15;}
    else if(gCount == 15) {gData = 0xC0; gCount = 16;}
    else if(gCount == 16) {gData = 0x80; gCount = 17;}
    DATA_PORT = ~gData;
}
//===============================================</pre><br>Pilotage du mode M2.
<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
static void GChenillard_updateM2() {
    if(gCount == 17) {gData = 0x01; gCount = 18;}
    else if(gCount == 18) {gData = 0x03; gCount = 19;}
    else if(gCount == 19) {gData = 0x07; gCount = 20;}
    else if(gCount == 20) {gData = 0x0E; gCount = 21;}
    else if(gCount == 21) {gData = 0x1C; gCount = 22;}
    else if(gCount == 22) {gData = 0x38; gCount = 23;}
    else if(gCount == 23) {gData = 0x70; gCount = 24;}
    else if(gCount == 24) {gData = 0xE0; gCount = 25;}
    else if(gCount == 25) {gData = 0xC0; gCount = 26;}
    else if(gCount == 26) {gData = 0x80; gCount = 27;}
    DATA_PORT = ~gData;
}
//===============================================</pre><br>Pilotage du mode M3.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
static void GChenillard_updateM3() {
    if(gCount == 27) {gData = 0x01; gCount = 28;}
    else if(gCount == 28) {gData = 0x03; gCount = 29;}
    else if(gCount == 29) {gData = 0x07; gCount = 30;}
    else if(gCount == 30) {gData = 0x0F; gCount = 31;}
    else if(gCount == 31) {gData = 0x1E; gCount = 32;}
    else if(gCount == 32) {gData = 0x3C; gCount = 33;}
    else if(gCount == 33) {gData = 0xF0; gCount = 34;}
    else if(gCount == 34) {gData = 0xE0; gCount = 35;}
    else if(gCount == 35) {gData = 0xC0; gCount = 36;}
    else if(gCount == 36) {gData = 0x80; gCount = 0;}
    DATA_PORT = ~gData;
}
//===============================================</pre><br></div>
</div>
</div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="afficheur-7-segment">Afficheur 7-segment</a>
</h1>
<div class="Section6"><br>L'opérateur (code) permet de définir les codes des digits 7-segment dans la mémoire ROM du programme afin d'éviter de consommer de la mémoire RAM gratuitement.<br><br>Définition des codes des digits 7-segment.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
static code uchar gDigitMap[] = {
    0x3F, 0x06, 0x5B,0x4F, 0x66, 0x6D, 0x7D, 0x07, 0x7F, 0x6F
};
//===============================================</pre><br>Affichage des digits 7-segment.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void G7Seg_write(uchar _data) {
    DATA_PORT = ~gDigitMap[_data];
}
//===============================================</pre><br></div>
</div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="afficheur-7-segment--compteur-de-0-a-9-">Afficheur 7-segment (Compteur de 0 à 9)</a>
</h1>
<div class="Section6"><br>Schéma électrique.&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Initialisation de l'ordonnanceur.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
static void GSchTask_init7SegCount() {
    G7SegCount_init();
    GSch_addTask(G7SegCount_update, 1, 500);
}
//===============================================</pre><br>Initialisation de l'afficheur 7-segment.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void G7SegCount_init() {
    G7Seg_write(gData);
}
//===============================================</pre><br>Compteur de 0 à 9.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void G7SegCount_update() {
    G7Seg_write(gData);
    if(++gData &gt; 9) gData = 0;
}
//===============================================</pre><br></div>
</div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
<h1 class="Section4">
<a class="Section5" href="#" id="afficheur-7-segment--compteur-de-0-a-99-">Afficheur 7-segment (Compteur de 0 à 99)</a>
</h1>
<div class="Section6"><br>Schéma électrique.&nbsp;<br><br><div class="GImg1 Img1"><img alt="image.png" src="data:image/png;base64,"></div><br>Initialisation de l'ordonnanceur.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
static void GSchTask_init7SegCount2() {
    G7SegCount2_init();
    GSch_addTask(G7Seg2_update, 0, 10);
    GSch_addTask(G7SegCount2_update, 1, 500);
}
//===============================================</pre><br>Initialisation des afficheurs 7-segment.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void G7SegCount2_init() {
    G7Seg2_write(gData);
}
//===============================================</pre><br>Rafraichissement des afficheurs 7-segment.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void G7Seg2_update() {
    uchar lData = gDataValue;
    if(gCmdSelect == 0) {
        lData = lData%10;
        G7Seg2_writeData(1, lData);
        gCmdSelect = 1;
    }
    else if(gCmdSelect == 1) {
        lData = (lData/10)%10;
        G7Seg2_writeData(0, lData);
        gCmdSelect = 0;
    }
}
//===============================================</pre><br>Compteur de 0 à 99.<br><br><pre class="GCode1 Code1 AceCode" data-mode="c_cpp" data-theme="gruvbox" data-bg-color="transparent" style="background-color: transparent;">//===============================================
void G7SegCount2_update() {
    G7Seg2_write(gData);
    gData += 10;
    if(gData &gt; 99) gData = 0;
}
//===============================================</pre><br></div></div></div></div><br><div class="GSection1 Section1">
<div class="Section2">
<div class="Section3">
